import React from 'react';
import styles from './Window.module.css'

const Window =(props)=>(
    <div className={styles.Window}>
        <div>
            {props.name}
            {props.counterBrick}
            {props.castle}
        </div>
        <div className={styles.Developing} onClick={props.click}>^roziwn^</div>
    </div>
);

 export default Window
